let openedTabs = [];

function generateRandomQuery() {
    if (words.length === 0) {
        console.warn("Words array is empty!");
        return "random"; 
    }
    return words[Math.floor(Math.random() * words.length)];
}

function openBingSearch() {
    const randomQuery = generateRandomQuery();

    chrome.tabs.create({ url: `https://www.bing.com/search?q=${randomQuery}&form=TSASDS` }, function (tab) {
        if (chrome.runtime.lastError || !tab) {
            console.warn("Failed to open tab:", chrome.runtime.lastError?.message);
            return;
        }
        openedTabs.push(tab.id);
        setTimeout(() => closeLastTab(tab.id), 7000);
    });
}

function closeLastTab(tabId) {
    chrome.tabs.get(tabId, function (tab) {
        if (chrome.runtime.lastError || !tab) {
            console.warn("Tab already closed or not found:", tabId);
            return;
        }
        chrome.tabs.remove(tabId, function () {
            if (chrome.runtime.lastError) {
                console.warn("Error closing tab:", chrome.runtime.lastError.message);
            } else {
                console.log(`Closed tab ID: ${tabId}`);
            }
        });
    });
}

function startAutoSearch() {
    let searchCount = 0;
    let searchInterval = setInterval(() => {
        if (searchCount < 100) {
            openBingSearch();
            searchCount++;
        } else {
            clearInterval(searchInterval);
            console.log("Completed 100 searches for this profile.");
            chrome.runtime.sendMessage({ action: "closeProfile" });
        }
    }, 9000);
}

// ✅ Run when extension is first installed OR when browser starts
chrome.runtime.onInstalled.addListener(() => {
    console.log("Extension installed: Starting auto Bing search...");
    startAutoSearch();
});

chrome.runtime.onStartup.addListener(() => {
    console.log("Browser started: Running Bing searches...");
    startAutoSearch();
});

